INSERT INTO `libreriatema` (`libreria`, `tema`, `nombre`, `borrado`) VALUES
	('000011', '001', '<p><b>¿Como descargar sitios webs completos?</b><br>\r\nEscribe en la consola el siguiente comando:<br>\r\n#wget -r www.cisco.com\r\n</p>', ''),
	('000011', '002', '<p><b>Breve explicacion de la utilidad de los principales directorios linux:</b> <br>\r\n					/boot  ..........................Aqui se encuentran los archivos del kernel<br>\r\n					/dev   ..........................Archivos controladores de los dispositivos<br>\r\n					/etc   ..........................Archivos de configuracion del sistema<br>\r\n					/root  ..........................Directorio de inicio del usuario root<br>\r\n					/home  ..........................Directorios asignados a cada cuenta de usuario.<br>\r\n					/usr   ..........................Contiene la documentacion del usuario y aplicaciones para el usuario</p>', ''),
	('000011', '003', '<table width="95%" border="0">\r\n  <tr class="inc">\r\n    <td width="388" scope="col" align="center">comandos\r\n      </th>\r\n    <th width="315" scope="col">acciones</th>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><p align="left">#cd<br />\r\n      #dc/directorio</p>    </th>\r\n    <td>cambio de directorio </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><p align="left">#CTRL+D<br />\r\n      #logo( )t<br />\r\n      #exit</p>    </th>\r\n    <td>salir de session </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th height="23" scope="row"><p align="left">#halt<br />\r\n        #init<br />\r\n        #shutdow-go-y</p>      </th>\r\n    <td>apagar sistema </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><p align="left">#reboot<br />\r\n      #init 6 </p>    </th>\r\n    <td>reiniciar sistema </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th height="30" scope="row"><p align="left">#cat archivo<br />\r\n      #less archivo<br />\r\n      #more archivo  </p>    </th>\r\n    <td>visualizadores de fivheros </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><p align="left">#vi archivo<br />\r\n      #\r\n      vi carta1  </p>    </th>\r\n    <td>editores de ficheros </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><div align="left">#mkdir name </div></th>\r\n    <td>crea directorio name </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><div align="left">#mv/root/carta1      /usr/local </div></th>\r\n    <td>mueve carta1 a user local </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><div align="left">#mv nombre-antiguo nombre-nuevo </div></th>\r\n    <td>renombra ficheros </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><div align="left">#cp/usr/games/archivo/home/luis/</div></th>\r\n    <td>copia archivo en Home/luis </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><div align="left">#wget-r www.cisco.com </div></th>\r\n    <td>descarga la pagina web con enlaces </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th height="23" scope="row"><p align="left">#cm &lt;nombre del archivo o directorio&gt;</p>    </th>\r\n    <td>borrado de archivos </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><div align="left">#eemacs(1);ee(1)</div></th>\r\n    <td>editor de texto </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><div align="left">#cp/root/xorg.conf.new      lete/x11/xorg.conf </div></th>\r\n    <td>&nbsp;</td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><p align="left">#su<br />\r\n      password:______</p>    </th>\r\n    <td>cambiar al directorio raiz </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th scope="row"><p align="left">#root:/dpkgreconfigure- xserver-xfree86<br />\r\n      #\r\n      root:/dpkgreconfigure- xserver-xorg</p>    </th>\r\n    <td>&nbsp;</td>\r\n  </tr>\r\n</table>', ''),
	('000011', '005', '<table width="659" border="0">\r\n  <tr>\r\n    <th colspan="2" scope="col"align="center" class="inc">Uso De Los Principales Directorios </th>\r\n  </tr>\r\n  <tr class="inc">\r\n    <th width="221" scope="col">Comandos</th>\r\n    <th width="428" scope="col"align="center">accion</th>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row" align="left" class="th">/boot/</th>\r\n    <td>Archivos kernel </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">/dev/</th>\r\n    <td>archivos controladores de dispositivos </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">/etc/</th>\r\n    <td>archivo de configuracion del sistema </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">/root/</th>\r\n    <td>directorio de inicio del usuario root </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">/home/</th>\r\n    <td>directorio asingado a cada cuenta de usuario </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">/usr/</th>\r\n    <td>contiene documentacion del usuario</td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#halt<br />\r\n      #init0<br />\r\n      #shutdown -go -y</th>\r\n    <td>Apagar el sistema </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#fdisk -1 </th>\r\n    <td>lista las particiones del disco </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#ls</th>\r\n    <td>lista archios y directorios </td>\r\n  </tr>\r\n  <tr>\r\n    <th height="28" scope="row"align="left" class="th">#who</th>\r\n    <td>muesra los usuarios conectados a mi sistema </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#clear(CTRL+L)</th>\r\n    <td>limpia la pantalla </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#q</th>\r\n    <td>salir</td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#cal</th>\r\n    <td>calendario</td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#history</th>\r\n    <td>muestra la lista de todos los comandos usados por el usuario </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#cat archivo<br />\r\n      #lessArchivo<br />\r\n      #Zmore</th>\r\n    <td>visualizadors del fichero </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#setup<br />\r\n      #linuxconf<br />\r\n      #netconfig</th>\r\n    <td><p>(configuracion de ispositivos de red)</p>\r\n    <p>UTLILITARIOS DE CONFIGURACION </p></td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#Groupadd</th>\r\n    <td>Crea el grupo de alumnos align=&quot;left&quot; class=&quot;th&quot;</td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#AdduserMaria</th>\r\n    <td>Crea el usuario maria </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#passwd Maria </th>\r\n    <td>Le asigna un password a maria </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#adduserCarlos -g escorpio </th>\r\n    <td>Crea el usuario Carlos dentro del grupo Escorpio </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#userdel Manuel</th>\r\n    <td>borra el usuario manuel </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#rm -rf Manuel </th>\r\n    <td>Borra el usuario manuel </td>\r\n  </tr>\r\n  <tr>\r\n    <th colspan="2" scope="row"align="center" class="inc">Tratamiento Del Archivo de Directorio </th>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#cp a -r/a/b </th>\r\n    <td>-r para copiar directorios </td>\r\n  </tr>\r\n  <tr>\r\n    <th scope="row"align="left" class="th">#cp -rf musica /home/luis</th>\r\n    <td>copia un directorio con contenido al directorio luis </td>\r\n  </tr>\r\n</table>', ''),
	('000011', '004', '<table width="393" border="0">\r\n  <tr>\r\n    <td width="387" class="inc" scope="col" align="center">Instalar MYSQL </td>\r\n  </tr>\r\n  <tr class="th">\r\n    <td height="90" class="th" scope="row" align="left">$sudo aptitude instalar mysql-server<br />\r\n      $sudo/usr\r\n      /bin/mysql/admin-v root password tu_pasword_de_usuario_root\r\n      <p></p></td>\r\n  </tr>\r\n  <tr class="th">\r\n    <td class="th" scope="row"><p>Solucionar Cambiar Contrase&ntilde;a </p></td>\r\n  </tr>\r\n  <tr class="th">\r\n    <td class="th" scope="row" align="left" >$mysql -u root mysql/<br />\r\n      &gt;update user set password=pasword(\'cambiame_cambiame_cambiame\') where user=\'root\';<br />\r\n      &gt;flush privileges\r\n      <p></p></td>\r\n  </tr>\r\n  <tr class="th">\r\n    <td height="25" class="th" scope="row"><p>crear una base de datos </p></td>\r\n  </tr>\r\n  <tr class="th">\r\n    <td class="th" scope="row"align="left">$Sudo mysql<br />\r\n      mysql&gt;create database nombre_de_la_base_de_datos;quit </div></td>\r\n  </tr>\r\n  <tr class="th">\r\n    <th class="th" scope="row"><p>Actualizar Manualmente UBUNTU </p></th>\r\n  </tr>\r\n  <tr class="th">\r\n    <td class="th" scope="row" align="left">$sudo aptitude update<br />\r\n      $sudo aptitude upgrade</p>\r\n        <p align="left" class="th">backup:  /etc/x11/xorg .conf.200605042238 <br />\r\n          fuente: www.fentlinux.con/web/?q=node/565<br />\r\n          backup: /etc/x11/xorg.conf.20060542323<br />\r\n          /etc/x11/xorg.conf.200605042345</p></td>\r\n  </tr>\r\n</table>', '');
