INSERT INTO `multimedia` (`multimedia`, `genero`, `tipo`, `autor`, `titulo`, `orden`, `letra`, `url`, `icono`, `borrado`) VALUES
	('000001', '01', '01', 'Danilo Montero', 'Al estar aquÃ­', '09', 'Al estar en la presencia de tu divinidad&lt;br&gt;y al contemplar la hermosura de tu santidad&lt;br&gt;mi esp&iacute;ritu se alegra, en tu majestad&lt;br&gt;te adoro a t&iacute;, te adoro a t&iacute;. &lt;br&gt;&lt;br&gt;Cuando veo la grandeza de tu dulce amor&lt;br&gt;y compruebo la pureza de tu corazon&lt;br&gt;mi esp&iacute;ritu se alegra en tu majestad&lt;br&gt;te adoro a t&iacute;, te adoro a t&iacute;&lt;br&gt;&lt;br&gt;Y al estar aqu&iacute;, delante de t&iacute; te adorar&eacute;&lt;br&gt;postrado ante t&iacute;, mi coraz&oacute;n te adora o Dios&lt;br&gt;y siempre quiero estar para adorar y contemplar tu santidad&lt;br&gt;te adoro a ti Senor, te adoro a t&iacute;&lt;br&gt; &lt;style type=&quot;text/css&quot;&gt;body {	background: #FFF;}&lt;/style&gt;&lt;style type=&quot;text/css&quot;&gt;body {	background: #FFF;}&lt;/style&gt;&lt;style type=&quot;text/css&quot;&gt;body {	background: #FFF;}&lt;/style&gt;&lt;style type=&quot;text/css&quot;&gt;body {	background: #FFF;}&lt;/style&gt;&lt;style type=&quot;text/css&quot;&gt;body {	background: #FFF;}&lt;/style&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\nbody {\r\n	background: #FFF;\r\n}\r\n&lt;/style&gt;', 'https://www.youtube.com/embed/XnWL0tzuIZM', '', ''),
	('000002', '01', '01', 'Danilo Montero', 'Canta al SeÃ±or', '09', 'Canta al Se&ntilde;or toda la creaci&oacute;n&lt;br&gt;honra y poder majestad sean al Rey&lt;br&gt;contestar&aacute;n y el mar rugira al sonar de tu nombre&lt;br&gt;&lt;br&gt;Canto con gozo al mirar tu poder&lt;br&gt;por siempre yo te amar&eacute; y dir&eacute;&lt;br&gt;incomparables promesas me das Se&ntilde;or&lt;br&gt;&lt;br&gt;Mi Cristo, mi Rey, nadie es como t&uacute;&lt;br&gt;toda mi vida quiero exaltar&lt;br&gt;las maravillas de tu amor&lt;br&gt;consuelo refugio, torre de fuerza&amp;nbsp; y poder&lt;br&gt;todo mi ser, yo que soy&lt;br&gt;nunca cese de adorar&lt;br&gt; \r\n&lt;style type=&quot;text/css&quot;&gt;\r\nbody {\r\n	background: #FFF;\r\n}\r\n&lt;/style&gt;', 'https://www.youtube.com/embed/uGtofxAi9cY', '', ''),
	('000004', '01', '01', 'Marcos Barrientos', 'EspÃ­ritu Ven', '09', 'Ven esp&iacute;ritu ven y ll&eacute;name Se&ntilde;or&lt;br&gt;con tu preciosa unci&oacute;n ( BIS ).&lt;br&gt;&lt;br&gt;Purif&iacute;came y l&aacute;vame&lt;br&gt;renu&eacute;vame, rest&aacute;urame Se&ntilde;or&lt;br&gt;con tu poder.&lt;br&gt;&lt;br&gt;Purif&iacute;came y l&aacute;vame&lt;br&gt;renu&eacute;vame, rest&aacute;urame Se&ntilde;or&lt;br&gt;te quiero conocer.&lt;br&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\nbody {\r\n	background: #FFF;\r\n}\r\n&lt;/style&gt;', 'https://www.youtube.com/embed/tux82zp0YVY', '', ''),
	('000005', '01', '01', 'Danilo Montero', 'Hay Momentos', '09', '&lt;style type=&quot;text/css&quot;&gt;\r\nbody {\r\n	background: #FFF;\r\n}\r\n&lt;/style&gt;', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=d5436de" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=d5436de" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', ''),
	('000006', '01', '01', 'Daniel Calvetti', 'La ultima palabra', '09', '&lt;style type=&quot;text/css&quot;&gt;\r\nbody {\r\n	background: #FFF;\r\n}\r\n&lt;/style&gt;', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=9b6e397" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=9b6e397" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', ''),
	('000007', '01', '01', 'Martin Valverde', 'Vida', '11', '', '', '', ''),
	('000008', '01', '01', 'Misa', 'No Necesito Saber', '09', 'Yo no entiendo teolog&iacute;a, ni menos<br>ideolog&iacute;as, pero en el fondo de mi ser,<br>yo te quiero conocer. Yo no entiendo de <br>liturgia, ni en el culto lo que hay que hacer,<br>solo se que es muy bonito cuando te puedo <br>tener.<br><br>No necesito saber, ni que me expliquen,<br>yo se que existes (vives) porque (..).<br>Te siento dentro de mi. En la alegr&iacute;a<br>estas tu, y en el silencio; en el amor,<br>en la paz; en cada momento ( BIS )<br><br>No entiendo filosof&iacute;a, ni tampoco se<br>porque se sigue moviendo el mundo<br>pero siempre hacia el rev&eacute;s. No entiendo<br>psicolog&iacute;­a que me dice como hay que ser,<br>solo creo que tu vives en aquel que hace el<br>bien.<br><br>No necesito saber, ni que me expliquen,<br>yo se que existes (vives) porque (...)<br>Te siento dentro de mi. En la alegr&iacute;a<br>estas t&uacute;, y en el silencio, en el amor,<br>en la paz, en cada momento. ( BIS )<br>Y en cada encuentro, en cada momento.<br>', '', '', ''),
	('000009', '01', '01', 'Luis Enrique Ascoy', 'Rezo por ti', '11', 'Rezo por t&iacute; y le pido a mi Senor&lt;br&gt;que derrame sobre t&iacute;, toda su paz en tu interior&lt;br&gt;te amo y rezo por t&iacute;, para que en tu coraz&oacute;n&lt;br&gt;reine siempre la alegr&iacute;a, la verdad y el perd&oacute;n&lt;br&gt;&lt;br&gt;Que Dios te bendiga y proteja cada d&iacute;a&lt;br&gt;que ilumine tu raz&oacute;n y te de una nueva vida desde hoy&lt;br&gt;&lt;br&gt;CORO&lt;br&gt;y que fluya su amor a traves de mis manos&lt;br&gt;y que expulse al temor, a la angustia y al llanto&lt;br&gt;Que la paz de mi Senor Jes&uacute;s te renueve a cada paso&lt;br&gt;y hoy mismo ba&ntilde;e con su luz las sombras de tu pasado&lt;br&gt;&lt;br&gt;Rezo por t&iacute; sin ponerte condici&oacute;n.&lt;br&gt;ni tener la expectativa de pedirte alg&uacute;n favor&lt;br&gt;tan solo yo rezo por t&iacute;, pues de todo coraz&oacute;n&lt;br&gt;quiero verte mas feliz y en el camino del Se&ntilde;or&lt;br&gt;&lt;br&gt;Por eso te pongo en las manos de Mar&iacute;a&lt;br&gt;Y bajo su protecci&oacute;n ella cuide de tu vida desde hoy&lt;br&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\nbody {\r\n	background: #FFF;\r\n}\r\n&lt;/style&gt;', 'https://www.youtube.com/embed/xADi9FKBiQE', '', ''),
	('000010', '01', '01', 'Coro Santa Rosa', 'Cristos Jovenes', '01', 'J&Oacute;VENES CRISTOS J&Oacute;VENES&lt;br&gt;NECESITA EL MUNDO DE HOY.&lt;br&gt;J&Oacute;VENES CRISTOS J&Oacute;VENES&lt;br&gt;QUE DEVUELVAN LA F&Eacute; EN EL AMOR.&lt;br&gt;&lt;br&gt;Que destruyan en la tierra la injusticia y&lt;br&gt;falsedad, que construyan un ma&ntilde;ana&lt;br&gt;lleno de fraternidad&lt;br&gt;&lt;br&gt;Que en lugar de la miseria den al hombre&lt;br&gt;dignidad, y liberen al esclavo con trabajo y&lt;br&gt;libertad.&lt;br&gt;&lt;style type=&quot;text/css&quot;&gt;body {	background: #FFF;}&lt;/style&gt;&lt;style type=&quot;text/css&quot;&gt;body {	background: #FFF;}&lt;/style&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\nbody {\r\n	background: #FFF;\r\n}\r\n&lt;/style&gt;', 'https://www.youtube.com/embed/wQaabsEVQbY', '', ''),
	('000011', '01', '01', 'Coro Santa Rosa', 'Aleluya', '04', 'Aleluya Gloria Aleluya ( 3 veces )<br><br>Estar alegres alegres a Dios<br>habitantes de toda la tierra<br>Canta a Dios con alegr&iacute;a<br>la vida es un presente con j&uacute;bilo.<br>', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=6d4ce7c" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=6d4ce7c" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', ''),
	('000012', '01', '01', 'Coro Santa Rosa', 'Ofertorio', '05', '', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=6c8c54a" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=6c8c54a" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', 'S'),
	('000013', '01', '01', 'Coro Santa Rosa', 'Santo ( Huayno )', '06', 'Santo, Santo, Santo es el Se&ntilde;or Dios del<BR>universo (bis). El cielo y la tierra est&aacute;n <BR>llenos de tu gloria ( bis )<BR>Hosanna, hosanna, hosanna, hosanna en lo<BR>alto del cielo (4). Bendito es el que viene en<BR>nombre del Se&ntilde;or (2)<BR>', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=aae9cbe" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=aae9cbe" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', ''),
	('000014', '01', '01', 'Coro Santa Rosa', 'Perd&oacute;n de los ap&oacute;stoles', '02', 'Se&ntilde;or ten piedad de nosotros, de nosotros<br>ten piedad.<br>Se&ntilde;or ten piedad de nosotros, oh, oh, oh,<br>Se&ntilde;or, de nosotros ten piedad. Cristo...<br>', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=fa4f5a0" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=fa4f5a0" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', ''),
	('000015', '01', '01', 'Coro Santa Rosa', 'Gloria al SeÃ±or', '03', '&lt;!--[if gte mso 9]&gt;&lt;xml&gt;\r\n \r\n  \r\n \r\n&lt;/xml&gt;&lt;![endif]--&gt;Gloria al\r\nSe&ntilde;or que est&aacute; en el cielo,&lt;br&gt;A&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;F#m&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp; &lt;/span&gt;D&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;E&lt;br&gt;gloria al Se&ntilde;or que est&aacute; en la tierra&lt;br&gt;A&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;F#m&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp; &lt;/span&gt;D&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;E&lt;br&gt;paz a los hombres de buena voluntad. &lt;br&gt;A F#m D E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;A F#m D&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp; &lt;/span&gt;E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;A F#m D&lt;br&gt;te alabamos Se&ntilde;or, bendecimos tu amor&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;A F#m D&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;A F#m D&lt;br&gt;y con tu dulce paz damos tu bendici&oacute;n. &lt;span style=&quot;mso-spacerun:yes&quot;&gt;&lt;br&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;A F#m D&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;A F#m D&lt;br&gt;&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;mso-bidi-font-weight:bold&quot; lang=&quot;ES-MX&quot;&gt;&lt;b&gt;\r\n&lt;br&gt;\r\n&lt;/b&gt;Hijo de Dios eres tu Cristo &lt;br&gt;\r\nA&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;F#m&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp; &lt;/span&gt;D&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&lt;/span&gt;E&lt;br&gt;\r\ny est&aacute;s sentado a su derecha&lt;br&gt;\r\nA&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;F#m&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp; &lt;/span&gt;D&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;E&lt;br&gt;\r\npaz a las almas que suplican perd&oacute;n, &lt;br&gt;\r\nA F#m D E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;A F#m D&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;\r\n&lt;/span&gt;E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&lt;/span&gt;A F#m D&lt;br&gt;\r\nte alabamos Se&ntilde;or, bendecimos tu amor&lt;br&gt;\r\n&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;A F#m D&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;A F#m D&lt;br&gt;\r\nSanto Esp&iacute;ritu tu Gracia danos hoy. (BIS)&lt;br&gt;\r\n&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;\r\n&lt;/span&gt;A F#m D&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;E&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;mso-spacerun:yes&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;A F#m D&lt;/span&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\nbody {\r\n	background: #FFF;\r\n}\r\n&lt;/style&gt;', 'https://www.youtube.com/embed/7_NbKKZhxBM', '', ''),
	('000016', '01', '01', 'Coro Santa Rosa', 'Padre Nuestro', '08', '<P>Padre Nuestro que est&aacute;s en el cielo&nbsp;&nbsp;<BR>santificado sea tu nombre <BR>Venga a&nbsp;nosotros, tu reino,<BR><BR>H&aacute;gase tu voluntad as&iacute; en la tierra como en el cielo<BR>El pan danos hoy, nuestro pan de cada d&iacute;a<BR>Perdona nuestras ofensas as&iacute; como<BR>perdonamos a los que nos ofenden</P><P>Y no nos dejes caer en la tentaci&oacute;n<BR>mas l&iacute;branos del mal AM&Eacute;N,AM&Eacute;N</P>', '', '', ''),
	('000017', '01', '01', 'Coro Santa Rosa', 'Padre Nuestro', '', '', '', '', 'S'),
	('000018', '01', '01', 'Coro Santa Rosa', 'Padre Nuestro', '01', '', '', '', 'S'),
	('000019', '01', '01', 'Coro Santa Rosa', 'Padre Nuestro', '01', '', '', '', 'S'),
	('000020', '01', '01', 'Coro Santa Rosa', 'Padre Nuestro', '01', '', '', '', 'S'),
	('000021', '01', '01', 'Coro Santa Rosa', 'Padre Nuestro', '01', '', '', '', 'S'),
	('000022', '01', '01', 'Coro Santa Rosa', 'Escucha Padre a tu pueblo', '07', 'Escucha Padre a tu pueblo que te canta hoy', '', '', 'S'),
	('000023', '01', '01', 'Coro Santa Rosa', 'Escucha Padre a tu pueblo', '07', 'Escucha Padre a tu pueblo que te canta hoy,<br>escucha que te imploramos<br>por la salvaci&oacute;n ( BIS )<br><br>Que haya entre los hombres paz, amor y f&eacute;<br>que cesen las guerras, el odio y la maldad. ( BIS ).<br><br>Unidos todos cantemos: Viva el Se&ntilde;or<br>unidos todos gritemos: queremos la paz!<br>queremos la paz hermanos;<br>queremos la paz,<br>Queremos la paz hermanos, queremos la paz. ( BIS )<br>', '', '', ''),
	('000024', '01', '01', 'Coro Santa Rosa', 'Un niÃ±o se te acerco', '05', '<P>Un niÃ±o se te acerco aquella tarde<BR>sus cinco panes te dio para ayudarte<BR>los dos hicieron que ya no hubiera hambre ( BIS )</P><P>La tierra, el aire y el sol son tu regalo<BR>y mil estrellas de luz, sembro tu mano<BR>El hombre pone su amor y su trabajo. ( BIS )</P><P>Tambien yo quiero poner sobre tu mano<BR>mis cinco panes que son una promesa<BR>de darte todo mi amor y mi pobreza ( BIS )</P>', '', '', 'S'),
	('000025', '01', '01', 'Coro Santa Rosa', 'Un ni&ntilde;o se te acerco', '05', '<P>Un ni&ntilde;o se te acerc&oacute; aquella tarde<BR>sus cinco panes te di&oacute; para ayudarte<BR>los dos hicieron que ya no hubiera hambre ( BIS )</P><P>La tierra, el aire y el sol son tu regalo<BR>y mil estrellas de luz, sembro tu mano<BR>El hombre pone su amor y su trabajo. ( BIS )</P><P>Tambi&oecute;n yo quiero poner sobre tu mano<BR>mis cinco panes que son una promesa<BR>de darte todo mi amor y mi pobreza ( BIS )</P>', '', '', ''),
	('000026', '01', '01', 'Coro Santa Rosa', 'Una vez mas rezar&eacute;', '02', '<P>Una vez mas rezar&eacute;, de rodillas me pondr&eacute;<BR>puede ser que una vez mas el me perdone<BR><BR>Le dir&eacute; que luch&eacute; en vano, que pequ&eacute; pues soy humano<BR>puede ser que una vez mas el me perdone</P><P>Por un Dios que conoci&oacute; la tentaci&oacute;n, del amigo la<BR>traici&oacute;n, yo no dudo me perdone: Dios amigo</P><P>Yo vi sufrir a mi hermano, cuando bastaba una mano<BR>puede ser que una vez mas el me perdone<BR><BR>Muri&oacute; pobre y desahuciado y yo con brazos cruzados<BR>Puede ser que tambi&eacute;n eso &Eacute;l me perdone</P>', '', '', ''),
	('000027', '01', '01', 'Coro Santa Rosa', 'Una vez mas rezare', '02', '<P>Una vez mas rezare, de rodillas me pondre<BR>puede ser que una vez mas el me perdone<BR><BR>Le dire que luche en vano, que peque pues soy humano<BR>puede ser que una vez mas el me perdone</P><P>Por un Dios que conocio la tentacion, del amigo la<BR>traicion, yo no dudo me perdone: Dios amigo</P><P>Yo vi sufrir a mi hermano, cuando bastaba una mano<BR>puede ser que una vez mas el me perdone<BR><BR>Murio pobre y desahuciado y yo con brazos cruzados<BR>Puede ser que tambien eso El me perdone</P>', '', '', 'S'),
	('000028', '01', '01', 'Coro Santa Rosa', 'H&aacute;blame', '09', 'Yo siento Se&ntilde;or, que T&uacute; me amas,<br>Yo siento Se&ntilde;or, que te puedo amar,<br>H&aacute;blame Se&ntilde;or, que tu siervo escucha!<br>H&aacute;blame Senor Â¿ Qu&eacute; quieres de mi ?.<br><br>Se&ntilde;or Tu haz sido grande para mi<br>En el desierto de mi vida, hablame!.<br>Yo quiero estar dispuesto a todo<br>Toma mi ser, mi coraz&oacute;n es para t&iacute;<br>Por eso canto tus maravillas<br>Por eso canto tu amor.<br><br>Te alabo, Jes&uacute;s, por tu grandeza,<br>Mil gracias te doy por tu gran amor.<br>Heme aqu&iacute; Se&ntilde;or para acompa&ntilde;arte!<br>Heme aqu&iacute;! ¿Qu&eacute; quieres de m&iacute;?<br>', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=a546768" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=a546768" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', ''),
	('000029', '01', '01', 'Coro Santa Rosa', 'Senor no ha sido facil', '07', 'Senor no ha sido facil', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=a546768" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=a546768" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', 'S'),
	('000030', '01', '01', 'Coro Santa Rosa', 'Alma Misionera', '10', 'Se&ntilde;or toma mi vida nueva,<br>antes de que la espera / desgaste a&ntilde;os en mi.<br>Estoy dispuesto a lo que quieras<br>no importa lo que sea, tu ll&aacute;mame a servir.<br><br>LL&Eacute;VAME DONDE LOS HOMBRES<br>NECESITEN TUS PALABRAS<br>NECESITEN TUS GANAS DE VIVIR.<br>DONDE FALTE LA ESPERANZA,<br>DONDE FALTE LA ALEGR&Iacute;A,<br>SIMPLEMENTE POR NO SABER DE T&Iacute;.<br><br>Te doy mi coraz&oacute;n sincero<br>para gritar sin miedo,<br>tu grandeza, Se&ntilde;or.<br>Tendr&eacute; mis manos sin cansancio<br>tu historia entre mis labios y fuerza en la<br>oraci&oacute;n.<br><br>Y as&iacute; en marcha ir&eacute; cantando<br>por calles predicando<br>lo bello que es tu amor<br>Se&ntilde;or, tengo alma misionera,<br>cond&uacute;ceme a la tierra que tenga sed de Dios<br>', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=01e9582" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=01e9582" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', ''),
	('000031', '01', '01', 'Coro Santa Rosa', 'Alma Misionera', '10', 'Senor toma mi vida nueva,<br>antes de que la espera / desgaste anyos en mi.<br>Estoy dispuesto a lo que quieras<br>no importa lo que sea, tu llamame a servir.<br>', '', '', 'S'),
	('000032', '01', '01', 'Sor Glenda', 'Yo creo en tu resurrecciÃ³n', '09', 'Yo creo en tu resurreci&oacute;n&lt;br&gt;porque puedo amar, puedo reir&lt;br&gt;puedo abrazar mi mayor enemigo y mirar por t&iacute;&lt;br&gt;&lt;br&gt;Yo creo en tu resurreci&oacute;n&lt;br&gt;porque tengo paz en mi coraz&oacute;n&lt;br&gt;porque puedo entregarme a pesar de todo este dolor&lt;br&gt;&lt;br&gt;Yo creo en tu resurreci&oacute;n&lt;br&gt;porque soy feliz junto a t&iacute;&lt;br&gt;porque me amas tanto que hasta moriste por m&iacute;&lt;br&gt;&lt;br&gt;Yo creo en tu resurreci&oacute;n&lt;br&gt;porque puedo amar&lt;br&gt;porque tengo, tanto, tanto, tanto para entregar&lt;br&gt;&lt;br&gt;Yo creo que tu Se&ntilde;or vivir&aacute;s en mi&lt;br&gt;Yo creo que tu Se&ntilde;or venceras en mi&lt;br&gt;Yo creo que tu Se&ntilde;or morar&aacute;s en mi&lt;br&gt;para siempre, para siempre Se&ntilde;or&lt;br&gt;&lt;br&gt;Yo creo en tu resurreci&oacute;n&lt;br&gt;porque ni el dolor, ni mi propio error&lt;br&gt;ninguna una angustia podr&aacute; separarme de tu amor&lt;br&gt;&lt;br&gt;Yo creo en tu resurreci&oacute;n&lt;br&gt;porque todo lo puedo con tu amor&lt;br&gt;porque se que cuidas de mi vida mejor que yo&lt;br&gt;&lt;br&gt;Yo creo en tu resurreci&oacute;n&lt;br&gt;porque puedo amar&lt;br&gt;porque puedo entregarme a pesar de todo este dolor.&lt;br&gt;&lt;br&gt;Yo creo en tu resurrecion&lt;br&gt;porque puedo amar&lt;br&gt;porque tengo tanto, tanto, tanto para entregar ( BIS )&lt;style type=&quot;text/css&quot;&gt;body {	background: #FFF;}&lt;/style&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\nbody {\r\n	background: #FFF;\r\n}\r\n&lt;/style&gt;', 'https://www.youtube.com/embed/bwJdlmjTNNQ', '', ''),
	('000033', '01', '01', 'Sor Glenda', 'Yo creo en tu resurreccion', '11', 'Yo', '', '', 'S'),
	('000034', '01', '01', 'Coro Santa Rosa', 'Esp&iacute;ritu de Dios', '02', 'ESP&Iacute;RITU DE DIOS, LLENA MI VIDA<br>LLENA MI ALMA, LLENA MI SER ( BIS )<br><br>Ven ll&eacute;name, ll&eacute;name con tu presencia;<br>ll&eacute;name, ll&eacute;name con tu poder;<br>ll&eacute;name, con tu bondad. ( BIS )<br>', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=18071d6" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=18071d6" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', ''),
	('000035', '01', '01', 'Coro Santa Rosa', 'Espiritu de Dios', '02', 'ESPIRITU DE DIOS, LLENA MI VIDA<br>LLENA MI ALMA, LLENA MI SER ( BIS )<br><br>Ven llename, llename con tu presencia;<br>llename, llename con tu poder;<br>llename, con tu bondad. ( BIS )<br>', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=18071d6" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=18071d6" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', 'S'),
	('000036', '01', '01', 'Coro Santa Rosa', 'Cordero de Dios', '02', 'Cordero de Dios, cordero de Dios&lt;br&gt;que quitas el pecado del mundo&lt;br&gt;danos la paz, danos la paz&lt;br&gt;&lt;br&gt;&lt;br&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\nbody {\r\n	background: #FFF;\r\n}\r\n&lt;/style&gt;', 'https://www.youtube.com/embed/P3Bo0FS5xDA', '', ''),
	('000037', '01', '01', 'Coro Santa Rosa', 'Cordero de Dios', '', 'Cordero de Dios, cordero de Dios<br>que quitas el pecado del mundo<br>danos la paz, danos la paz<br><br><br>', '', '', 'S'),
	('000038', '01', '01', 'Coro Santa Rosa', 'Santo de las Alabanzas', '06', 'Santo es el Senor mi Dios digno de alabanza<br>a &Eacute;l, el poder, el honor y la gloria ( BIS )<br><br>HOSANNA, HOSANNA,<br>HOSANNA OH SE&Ntilde;OR ( BIS ).<br><br>Bendito el que viene en nombre del Se&ntilde;or<br>con todos los santos cantamos para t&iacute; ( BIS )<br><br>HOSSANA, HOSSANA<br>HOSSANA OH SE&Ntilde;OR ( BIS )<br>', '', '', ''),
	('000039', '01', '01', 'Coro Santa Rosa', 'Santo de las Alabanzas', '06', 'Santo es el Senor mi Dios digno de alabanza<br>a El, el poder, el honor y la gloria ( BIS )<br><br>HOSANNA, HOSANNA,<br>HOSANNA OH SEÃ‘OR ( BIS ).<br><br>Bendito el que viene en nombre del Senor<br>con todos los santos cantamos para ti ( BIS )<br><br>HOSSANA, HOSSANA<br>HOSSANA OH SENOR ( BIS )<br>', '', '', 'S'),
	('000040', '01', '01', 'Coro Santa Rosa', 'Con amor te presento SeÃ±or', '05', 'Con amor te presento Senor, lo mejor de mi vida<br>te presento Senor mi amistad<br>Con amor te presento Senor, para ser mi manjar<br>la vina, el racimo, el trigal, el pan de mi hogar,<br>te presento con amor<br><br>Con mis manos abiertas a ti, contemplando tu lampara, <br>te presento Senor mi esperanza<br>Hacia ti se dirige mi barca, hacia el cielo se va<br>es largo el camino, el remar, ruta pascual<br>Dios me guia al caminar.<br><br>Con mi ofrenda tambien yo te doy, lo mejor de mis lagrimas<br>te presento Senor mi olor<br>te presento Senor mi oracion: ofertorio de amor<br>El grano enterrado ya es flor, la espina oblacion<br>la semilla redencion<br>', '', '', 'S'),
	('000041', '01', '01', 'Coro Santa Rosa', 'Con amor te presento Se&ntilde;or', '05', 'Con amor te presento Se&ntilde;or, lo mejor de mi vida<br>te presento Se&ntilde;or mi amistad<br>Con amor te presento Se&ntilde;or, para ser mi manjar<br>la vi&ntilde;a, el racimo, el trigal, el pan de mi hogar,<br>te presento con amor<br><br>Con mis manos abiertas a t&iacute;, contemplando tu l&aacute;mpara, <br>te presento Se&ntilde;or mi esperanza<br>Hacia t&iacute; se dirige mi barca, hacia el cielo se va<br>es largo el camino, el remar, ruta pascual<br>Dios me gu&iacute;a al caminar.<br><br>Con mi ofrenda tambi&eacute;n yo te doy, lo mejor de mis l&aacute;grimas<br>te presento Se&ntilde;or mi olor<br>te presento Se&ntilde;or mi oraci&oacute;n: ofertorio de amor<br>El grano enterrado ya es flor, la espina oblaci&oacute;n<br>la semilla redenci&oacute;n<br>', '<object classid="clsid:D27CDB6E-AE6D-11cf-96B8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,29,0" width="366" height="75"><param name="movie" value="http://www.goear.com/files/localplayer.swf" /><param name="FlashVars" value="file=6c8c54a" /><param name="quality" value="high" /><embed src="http://www.goear.com/files/localplayer.swf" flashvars="file=6c8c54a" quality="high" pluginspage="http://www.macromedia.com/go/getflashplayer" type="application/x-shockwave-flash" width="366" height="75"></embed></object>', '', ''),
