INSERT INTO `tema` (`tema`, `nombre`, `tipo`, `fecha`, `borrado`) VALUES
	('000003', '<p style="text-align: center;"><span style="font-size:12px;"><span style="font-family:verdana,geneva,sans-serif;"><strong>El idoma ingl&eacute;s y la educaci&oacute;n en el mundo globalizado</strong></span></span></p>\r\n\r\n<div align="left" class="fontmartin5" style="font-family: verdana; font-size: 12px; color: rgb(63, 86, 73); clip: rect(auto auto auto auto); margin: 10px 10px 0px 25px;">\r\n<p>La globalizaci&oacute;n reviste una importancia decisiva en los albores de este nuevo siglo. La globalizaci&oacute;n es ante todo un proceso econ&oacute;mico y financiero y un proceso cient&iacute;fico y tecnol&oacute;gico cuyas nuevas tecnolog&iacute;as de la informaci&oacute;n y la comunicaci&oacute;n est&aacute;n difundiendo una nueva forma de organizaci&oacute;n social basada en el saber, el cual se consolida con conocimiento de un idioma extranjero.</p>\r\n\r\n<p>En el reciente Foro Mundial sobre la Educaci&oacute;n Para Todos que se celebr&oacute; en abril del 2000 se confirm&oacute; la educaci&oacute;n para todos. En este sentido Internet es un instrumento particularmente valioso para el desarrollo y un medio muy poderoso de difundir la informaci&oacute;n. Por esta raz&oacute;n se deben sentar las bases para la formulaci&oacute;n de pol&iacute;ticas y para una gesti&oacute;n acertada para el manejo de las nuevas tecnolog&iacute;as</p>\r\n\r\n<p>Situ&aacute;ndonos en esta nueva sociedad del conocimiento, vemos que la construcci&oacute;n del conocimiento la formaci&oacute;n del llamado potencial humano debe convertirse en un tema prioritario. Son necesarios proyectos educativos que sit&uacute;en la educaci&oacute;n en las agendas de desarrollo en actitud de discernimiento y de b&uacute;squeda de la propia identidad.</p>\r\n\r\n<p>La construcci&oacute;n del conocimiento en la educaci&oacute;n y la gesti&oacute;n educativa comprometida con la calidad y la equidad implican pues un gran esfuerzo. Los sistemas de educaci&oacute;n deben adaptarse a los cambios del contexto social: long learning for all, educaci&oacute;n a distancia y el aprendizaje distribuido. Es aqu&iacute; donde la universidad juega un rol preponderante.</p>\r\n\r\n<p>Los pr&oacute;ximos cincuenta a&ntilde;os, las universidades cambiar&aacute;n m&aacute;s debido a las nuevas tecnolog&iacute;as: los ordenadores, los videos y las emisiones v&iacute;a sat&eacute;lite, en donde el saber organizado deber&aacute; constituirse en un proceso que durar&aacute; toda la vida.</p>\r\n\r\n<p>De este modo hablar de la educaci&oacute;n universitaria es ponerse a tono con la mayor&iacute;a de las universidades del mundo que est&aacute;n dedicadas a dos finalidades esenciales: la primera es crear conocimiento o hacer investigaci&oacute;n.</p>\r\n\r\n<p>En efecto la universidad es una de las organizaciones m&aacute;s importantes de la civilizaci&oacute;n occidental para cumplir el objetivo fundamental de la educaci&oacute;n de m&aacute;ximo nivel que es el de crear nuevo conocimiento o investigar en todos los campos del saber. En este contexto, el conocimiento de un idioma extranjero: ingl&eacute;s va a significar la apertura a un mundo de oportunidades, el desarrollo profesional, oportunidad de viajar, contactarse con otra cultura, intercambiar experiencias puesto que es el veh&iacute;culo del proceso de universalizaci&oacute;n del conocimiento.</p>\r\n\r\n<p>Sin embargo, el valor creciente del conocimiento como factor del desarrollo humano nos hace cada vez m&aacute;s cuestionadores ante aquellas instancias de la sociedad creadas para la formaci&oacute;n de profesionales, la producci&oacute;n y distribuci&oacute;n del conocimiento como es la universidad. &iquest;Es que estas instituciones se est&aacute;n innovando para mejorar la calidad de su servicio y ponerlo a la altura de los nuevos tiempos? &iquest;En qu&eacute; medida sus curr&iacute;culos est&aacute;n respondiendo a las demandas de un desarrollo integral de la persona y a la vez para la excelencia profesional?</p>\r\n\r\n<p>La contribuci&oacute;n de la universidad al desarrollo humano tiene diversas dimensiones y una de ellas se viabiliza (1) a trav&eacute;s del curr&iacute;culo. De all&iacute; se deduce que cambiar la universidad es sustancialmente cambiar su curr&iacute;culo.</p>\r\n\r\n<p>Una propuesta de innovaci&oacute;n ser&iacute;a la gesti&oacute;n de cambios con grados de innovaci&oacute;n, planificaci&oacute;n, participaci&oacute;n y documentaci&oacute;n.</p>\r\n\r\n<p>Al mirar ciertas experiencias de reforma podemos llamar la atenci&oacute;n en que los grados de innovaci&oacute;n pueden variar en funci&oacute;n a los distintos elementos del curr&iacute;culo. As&iacute; por ejemplo, podemos tener un plan de estudios realmente innovador, con nuevas especialidades, cursos con contenidos muy actualizados, sin embargo, el r&eacute;gimen de evaluaci&oacute;n expresa un grado menor de innovaci&oacute;n: igual sistema de calificaci&oacute;n, iguales instrumentos para evaluar. Hay que buscar la originalidad en una propuesta de reforma curricular respecto al curr&iacute;culo anterior</p>\r\n\r\n<p>La gesti&oacute;n de un cambio con grados de planificaci&oacute;n implica integrarse en la organizaci&oacute;n y mejorar todo lo que hace, desarrollar nuevas aplicaciones, aprender a innovar, organizarse como proceso sistem&aacute;tico. Implica una mentalidad de planificaci&oacute;n a partir del aprendizaje de los &eacute;xitos y errores.</p>\r\n\r\n<p>La gesti&oacute;n de un cambio con grados de participaci&oacute;n sugiere voces de consenso en torno a la reforma curricular, reuniones plenarias de docentes. Se pueden registrar las potencialidades participativas de instancias complementarias que pueden generar un dinamismo participativo y corresponsable en el &aacute;mbito docente: designaci&oacute;n de una comisi&oacute;n de reforma curricular que puede ser el ente orientador del proceso, la que puede solicitar la formaci&oacute;n de comisiones de docentes para el trajo de ciertos temas, espacios de consensos, jornadas docentes. Por otro lado, se puede prever niveles de participaci&oacute;n estudiantil a partir de reuniones con los representantes estudiantiles y a la vez convocando a los estudiantes directamente en forma abierta por promociones o por especialidades.</p>\r\n\r\n<p>La gesti&oacute;n documentada de los cambios es la utilizaci&oacute;n de datos existentes, elaborar otros necesarios para la reflexi&oacute;n y toma de decisiones. Como se sabe dicha base de datos por copiosa que sea no es informaci&oacute;n, s&oacute;lo es la materia prima que tiene que organizarse para una tarea espec&iacute;fica aplicada a una decisi&oacute;n.</p>\r\n\r\n<p>La reforma significa que los docentes y autoridades aprendan a ser usuarios inteligentes de la informaci&oacute;n. A veces la fragilidad de una instituci&oacute;n se debe a la falta de una memoria institucional, la cual va restringiendo su compromiso para dar cuenta a la comunidad acad&eacute;mica del proceso seguido para decidir sus innovaciones.</p>\r\n\r\n<p>Para hacer que las facultades sean productoras de una cultura innovadora, ellas necesitan comunicar sus procesos innovadores. Se requiere pues de una gesti&oacute;n documentada. Todas las decisiones importantes tienen que estar documentadas, respaldada en textos escritos bien redactados, con fechas y autores.</p>\r\n\r\n<p>Estos elementos que hemos nombrado: grados de planificaci&oacute;n, documentaci&oacute;n, participaci&oacute;n, innovaci&oacute;n, deben formar parte de la reforma curricular, consolidado por la presencia de un idioma extranjero que ha de facilitar la actualizaci&oacute;n de conocimientos de una manera directa ayudando a una efectiva toma de decisiones.</p>\r\n\r\n<p>Hoy en el siglo XXI, en un mundo interconectado, el conocimiento del idioma ingl&eacute;s se ha convertido en el principal veh&iacute;culo del proceso de universalizaci&oacute;n del conocimiento y se ha convertido en un factor esencial de la formaci&oacute;n acad&eacute;mica y del desarrollo profesional. Nada mejor que el ambiente acad&eacute;mico universitario para entrar en contacto con el mundo y obtener una visi&oacute;n interdisciplinaria de la cultura de los distintos pueblos y civilizaciones.</p>\r\n\r\n<p>Fuente: http://sisbib.unmsm.edu.pe/bibvirtual/publicaciones/administracion/v05_n10/educacion.htm</p>\r\n</div>', '2', '2010-05-14', ''),
	('000002', '<p style="text-align: center;"><span style="font-size:12px;"><span style="font-family:verdana,geneva,sans-serif;"><strong>La gesti&oacute;n del conocimiento en las organizaciones modernas</strong></span></span></p>\r\n\r\n<div align="left" class="fontmartin5" style="font-family: verdana; font-size: 12px; color: rgb(63, 86, 73); clip: rect(auto auto auto auto); margin: 10px 10px 0px 25px;">\r\n<p>El objetivo de este tema es reflexionar sobre la importancia que tiene la gesti&oacute;n del conocimiento en las organizaciones, las cuales deben tener dentro de su visi&oacute;n la generaci&oacute;n de ventajas competitivas mediante el conocimiento, el capital intelectual y los activos intangibles.</p>\r\n\r\n<p>La gesti&oacute;n del conocimiento implica una relaci&oacute;n con la nueva econom&iacute;a y la sociedad de la informaci&oacute;n. Es por ello que debe integrarse la gesti&oacute;n del conocimiento en la pol&iacute;tica de recursos humanos de las organizaciones modernas a fin de crear y almacenar conocimiento para su posterior distribuci&oacute;n y uso. &Eacute;sta ser&aacute; la ventaja competitiva, el valor a&ntilde;adido que una empresa ha de crear para sus clientes: proponiendo el uso adecuado de la informaci&oacute;n, del conocimiento como fuente de diferenciaci&oacute;n en un mercado cada vez m&aacute;s competitivo y global.</p>\r\n\r\n<p>Los recursos tangibles de la organizaci&oacute;n tales como capital, mano de obra han de ser reemplazados por los recursos intangibles o capacidades, mezcla de habilidades y conocimientos que provienen de la creaci&oacute;n, obtenci&oacute;n, almacenamiento y difusi&oacute;n del conocimiento. Dicho conocimiento permitir&aacute; saber las necesidades de los clientes, c&oacute;mo mejorar el servicio de atenci&oacute;n, c&oacute;mo optimizar los procesos de producci&oacute;n, resolver problemas, aprovechar nuevas oportunidades de negocio.</p>\r\n\r\n<p>DATOS, INFORMACI&Oacute;N Y CONOCIMIENTO</p>\r\n\r\n<p>El modelo Datos-informaci&oacute;n-Conocimiento-Tecnolog&iacute;a de Newman (1977), el control y monitorizaci&oacute;n de los procesos producir&aacute;n s&oacute;lo datos que al ser analizados mediante t&eacute;cnicas estad&iacute;sticas, entre otras t&eacute;cnicas, proporcionar&aacute; informaci&oacute;n que al ser interpretada por miembros cualificados de la organizaci&oacute;n dar&aacute;n lugar al conocimiento &uacute;til. La informaci&oacute;n (cualitativa y cuantitativa) tiene poco valor por s&iacute; misma y s&oacute;lo se convierte en conocimiento cuando es procesada por el cerebro humano.</p>\r\n\r\n<p>Seg&uacute;n Nonaka (1995) hay dos tipos de conocimiento: el expl&iacute;cito o el que puede ser estructurado, almacenado y distribuido y el t&aacute;cito o el conocimiento que forma parte de las experiencias de aprendizaje personales de cada individuo y que resulta complicado, no imposible de estructurar, almacenar y distribuir.</p>\r\n\r\n<p>El uso de las tecnolog&iacute;as de la informaci&oacute;n y la comunicaci&oacute;n s&oacute;lo permitir&aacute;n almacenar y distribuir conocimiento expl&iacute;cito. Gracias a las posibilidades que ofrecen las redes de comunicaci&oacute;n, los archivos multimedia y las tecnolog&iacute;as audiovisuales el conocimiento t&aacute;cito pasa a ser conocimiento expl&iacute;cito. Dicho conocimiento expl&iacute;cito se almacena en bases de datos, bases documentales, intranets, extranets y sistemas de informaci&oacute;n para ejecutivos. Del uso de una buena estrategia de gesti&oacute;n se fomentar&aacute; la creaci&oacute;n de redes de colaboraci&oacute;n entre personas de la instituci&oacute;n y ajenas a ella y podr&aacute; elaborarse un mapa de conocimiento al que todos puedan acceder.</p>\r\n\r\n<p>Grant (1991) y Schoemaker (1992) proponen el uso adecuado de la informaci&oacute;n, en especial, del conocimiento como la fuente principal de diferenciaci&oacute;n en un mercado cada vez m&aacute;s competitivo y global.</p>\r\n\r\n<p>&iquest;QU&Eacute; ES LA GESTI&Oacute;N DEL CONOCIMIENTO?</p>\r\n\r\n<p>La gesti&oacute;n del conocimiento es un conjunto de procesos que dirigen el an&aacute;lisis, diseminaci&oacute;n, utilizaci&oacute;n y traspaso de experiencias, informaci&oacute;n y conocimientos entre los miembros de una organizaci&oacute;n para generar valor.</p>\r\n\r\n<p>Seg&uacute;n Ovum, la gesti&oacute;n del conocimiento es la tarea de desarrollar y explotar los recursos tangibles (infraestructura, los materiales) e intangibles (cocimientos, experiencias, el knowhow). No es el flujo indiscriminado de informaci&oacute;n a trav&eacute;s de una organizaci&oacute;n, ya que la informaci&oacute;n es simplemente un conjunto de datos. El conocimiento, el saber, implica depurar y a&ntilde;adir valor a la informaci&oacute;n, llegar a una soluci&oacute;n o decisi&oacute;n en una situaci&oacute;n real, interpretando esos datos dentro de un contexto</p>\r\n\r\n<p>La transferencia de esos conocimientos es lo que realmente aporta un valor diferencial, lo que puede significar grandes beneficios, reducci&oacute;n de costos y del tiempo en la toma de decisiones. Para esto se hace necesario potenciar el elemento social y la comunicaci&oacute;n humana en la trasferencia de los conocimientos, colaborar y trabajar en equipo.</p>\r\n\r\n<p>&iquest;C&Oacute;MO SE GESTIONA EL CONOCIMIENTO?</p>\r\n\r\n<p>Una buena gesti&oacute;n del conocimiento requiere un buen manejo del clima organizacional, las formas de liderazgo y conducci&oacute;n institucional, el manejo de los recursos humanos y del tiempo, la planificaci&oacute;n de tareas, la distribuci&oacute;n del trabajo y su productividad, la eficiencia de la administraci&oacute;n, el rendimiento de los recursos materiales, la buena calidad de los procesos organizacionales.</p>\r\n\r\n<p>Se requiere una adopci&oacute;n de procedimientos de acreditaci&oacute;n, el empleo de incentivos para premiar o sancionar el desempe&ntilde;o de gesti&oacute;n, empleo de esquemas de asistencia t&eacute;cnica focalizada, dise&ntilde;o de mecanismos de participaci&oacute;n de la comunidad organizacional.</p>\r\n\r\n<p>La gesti&oacute;n del conocimiento se inserta como un nuevo campo de investigaci&oacute;n ligado a la organizaci&oacute;n, las estrategias directivas y el uso de la tecnolog&iacute;a de la informaci&oacute;n.</p>\r\n\r\n<p>FASES</p>\r\n\r\n<p>La gesti&oacute;n del conocimiento es una disciplina en donde pueden describirse fases en el proceso que depender&aacute; del momento en que surge la iniciativa, la expectativa de lo que se obtendr&aacute; y la medida en que progrese, de las tecnolog&iacute;as empleadas, de su aceptaci&oacute;n en la cultura organizacional.</p>\r\n\r\n<p>Seg&uacute;n Nonaka?Takeuchi, la Gesti&oacute;n del Conocimiento es un proceso de interacci&oacute;n entre el conocimiento t&aacute;cito y expl&iacute;cito con una naturaleza din&aacute;mica y continua, constituyendo un espiral de transformaci&oacute;n permanente que se desarrolla en las siguientes fases:</p>\r\n\r\n<p>La socializaci&oacute;n que facilita compartir experiencias por medio de exposiciones orales, documentos, manuales y tradiciones orales.</p>\r\n\r\n<p>La exteriorizaci&oacute;n que supone hace tangible mediante el uso de met&aacute;foras, conocimiento dif&iacute;cil de consumir, integr&aacute;ndolo en la cultura de la organizaci&oacute;n.</p>\r\n\r\n<p>La combinaci&oacute;n que crea nuevo conocimiento por integraci&oacute;n de bases cognitivas.</p>\r\n\r\n<p>La interiorizaci&oacute;n que analiza las experiencias adquiridas en la puesta en pr&aacute;ctica de los nuevos conocimientos.</p>\r\n\r\n<p>La fase de la asimilaci&oacute;n que sintetiza dichas experiencias en la base cognitiva del trabajador.</p>\r\n\r\n<p>ELEMENTOS CLAVES PARA GESTIONAR EL CONOCIMIENTO</p>\r\n\r\n<p>El primer elemento para gerenciar una organizaci&oacute;n centrada en el conocimiento es considerar</p>\r\n\r\n<p>- El tiempo como factor cr&iacute;tico.<br />\r\n- La tecnolog&iacute;a no hace a una instituci&oacute;n m&aacute;s competente<br />\r\n- El mercado decide el &eacute;xito del producto independientemente de su calidad.<br />\r\n- La cultura organizacional que debe compartir el conocimiento y valorizar los resultados al futuro.<br />\r\n- La inversi&oacute;n en los activos de conocimiento debe ser una parte del planeamiento y el proceso de presupuestaci&oacute;n del capital financiero. Los activos del conocimiento deben ser mayores que los activos financieros.</p>\r\n\r\n<p>PRINCIPIOS DE LA GESTI&Oacute;N DEL CONOCIMIENTO</p>\r\n\r\n<p>- Favorecer la creatividad e innovaci&oacute;n del personal.<br />\r\n- Potenciar el conocimiento individual a trav&eacute;s de la formaci&oacute;n y la experiencia.<br />\r\n- Conseguir una red de comunicaci&oacute;n fluida y eficaz que garantice la accesibilidad de los empleados a la informaci&oacute;n.<br />\r\n- Coordinar la organizaci&oacute;n a todos los niveles, &aacute;reas y departamentos del centro educativo.</p>\r\n\r\n<p>FACTORES QUE DETERMINAN EL &Eacute;XITO EN EL DESARROLLO O IMPLEMENTACI&Oacute;N DE LA GESTI&Oacute;N DEL CONOCIMIENTO</p>\r\n\r\n<p>- Factores de direcci&oacute;n.<br />\r\n- Factores de recursos (financieros, humanos y fuentes de conocimientos).<br />\r\n- Factores ambientales (competencia, moda, mercados, tecnolog&iacute;as y pol&iacute;tica gubernamental).</p>\r\n\r\n<p>EL L&Iacute;DER EN LA GESTI&Oacute;N DEL CONOCIMIENTO</p>\r\n\r\n<p>Entre los factores que definen una pr&aacute;ctica adecuada y exitosa de la gesti&oacute;n del conocimiento, se encuentra el elemento de direcci&oacute;n que incluye las funciones de liderazgo: autocontrol, entusiasmo, empat&iacute;a, autoconciencia, persistencia, motivaci&oacute;n y destreza.</p>\r\n\r\n<p>PRINCIPALES ACTIVIDADES DE LOS RESPONSABLES DE LA GESTI&Oacute;N DEL<br />\r\nCONOCIMIENTO</p>\r\n\r\n<p>- Observar las fases del ciclo del conocimiento e implementar las actividades necesarias.<br />\r\n- Crear competencias claves y el patrimonio estrat&eacute;gico de la empresa.<br />\r\n- Observar el perfil profesional de los individuos que llevar&aacute;n a cabo la gerencia del conocimiento.<br />\r\n- Manejar las tecnolog&iacute;as claves: internet, comercio electr&oacute;nico.<br />\r\n- Involucrar a los departamentos de recursos humanos y sistemas a trav&eacute;s de la comunicaci&oacute;n en red y un estilo participativo y de colaboraci&oacute;n.<br />\r\n- Conocer los procesos de marketing, finanzas, calidad de la gesti&oacute;n, investigaci&oacute;n y desarrollo, servicios a los clientes, entre otros.</p>\r\n\r\n<p>IMPACTO DEL CAPITAL INTELECTUAL DE UNA ORGANIZACI&Oacute;N</p>\r\n\r\n<p>Si somos capaces de medir el capital intelectual de una organizaci&oacute;n, obtendremos una medida del impacto del conocimiento. Para Bellinger, la extensi&oacute;n en la cual una organizaci&oacute;n est&aacute; involucrada en compartir el conocimiento tiene un impacto sobre el crecimiento de la experiencia de base de la organizaci&oacute;n.</p>\r\n\r\n<p>HERRAMIENTAS PARA LA IMPLEMENTACI&Oacute;N DE SISTEMAS DE GESTI&Oacute;N DEL CONOCIMIENTO</p>\r\n\r\n<p>- Herramientas inform&aacute;ticas: sistema ERP (Enterprise, Resources Planning, Datawarehouse, Datamining)<br />\r\n- Herramientas de comunicaci&oacute;n: Groupware, Workflow, Call Center.<br />\r\n- Herramientas de mejoras continuas (TQM), opciones de Internet, Intranet y extranet<br />\r\n- Herramientas especiales: mapas conceptuales, tablero de comando.<br />\r\n- Herramientas para la gesti&oacute;n documental: compatibles con las tecnolog&iacute;as de Internet-intranet como los agentes inteligentes de b&uacute;squeda en Internet, redes neurales y Customer Relationship Managernent (CRM) o gerencia de las relaciones con el cliente.</p>\r\n\r\n<p>CICLO DE GENERACI&Oacute;N DE CONOCIMIENTO</p>\r\n\r\n<p>El conocimiento es un proceso recurrente que integra hechos e ideas en donde confluyen la experiencia basada en saberes adquiridos previamente del entorno y las interacciones personales. La confrontaci&oacute;n de las experiencias propias con experiencias ajenas (otros contextos) permite construir la teor&iacute;a o elaboraci&oacute;n de pensamiento aplicable a contextos diversos que van a convertirse en pr&aacute;ctica. El aprendizaje, retroalimentaci&oacute;n, interacci&oacute;n con el entorno constituyen la fuente del nuevo saber. El conocimiento crece en la medida en que circula, aumenta cuando se expone, sin agotarse por la circulaci&oacute;n ni desgastarse por su exposici&oacute;n.</p>\r\n\r\n<p>Es cierto que los datos y la informaci&oacute;n tambi&eacute;n circulan, se divulgan, se exponen pero s&oacute;lo se enriquecen a trav&eacute;s de la confrontaci&oacute;n, la aplicaci&oacute;n. La gesti&oacute;n del conocimiento se articula &iacute;ntegramente con los factores esenciales de la cultura de la organizaci&oacute;n. Por eso es indispensable que se despliegue a trav&eacute;s de toda la estructura y promueva cambios en la instituci&oacute;n.</p>\r\n\r\n<p>ELEMENTOS FACILITADORES DE LA GESTI&Oacute;N DEL CONOCIMIENTO</p>\r\n\r\n<p>Hay dos elementos que han facilitado la aparici&oacute;n del concepto de gesti&oacute;n del conocimiento: el desarrollo tecnol&oacute;gico y la concientizaci&oacute;n por parte del mundo empresarial de que el conocimiento es un recurso clave en sociedades y organizaciones.</p>\r\n\r\n<p>En este contexto el papel que desempe&ntilde;an las tecnolog&iacute;as de la informaci&oacute;n y la comunicaci&oacute;n radica en su habilidad para potenciar la comunicaci&oacute;n, la colaboraci&oacute;n y la b&uacute;squeda y generaci&oacute;n de informaci&oacute;n y conocimiento en un entorno laboral (cultura organizativa) que fomente los equipos de trabajo multidisciplinario, las relaciones personales entre trabajadores, con los clientes y las redes de colaboraci&oacute;n</p>\r\n\r\n<p>Seg&uacute;n Davenport (1998), la gesti&oacute;n del conocimiento deber&iacute;a preocuparse por explotar y desarrollar los activos de conocimiento a fin de llevar a cabo su misi&oacute;n estrat&eacute;gica.</p>\r\n\r\n<p>Vilaseca y Torrent (2001) comentan que una serie de fuerzas influyentes est&aacute; redefiniendo la econom&iacute;a (internet y la red de redes potenciada por el fen&oacute;meno de la econom&iacute;a digital) y la manera de entender los negocios. Estas fuerzas del cambio incluyen el fen&oacute;meno de la globalizaci&oacute;n, los niveles de competitividad y complejidad del entorno, las nuevas tecnolog&iacute;as, una serie de cambios en las demandas de los clientes (producci&oacute;n de bienes y servicios) y cambios en las estructuras pol&iacute;ticas y econ&oacute;micas.</p>\r\n\r\n<p>Con Internet, los costes de cambiar de proveedor disminuyen tanto en las transacciones B2C (business-to-consumer) como en las 13213 (business-to-business) y C2C (consumer-to-consumer). Por ello, la construcci&oacute;n de una relaci&oacute;n personal fuerte con el cliente permite diferenciar el servicio que ofrecemos con respecto al que ofrecen otros competidores, y as&iacute; se crean barreras de disuasi&oacute;n (lockins) que incrementan los costes de cambio para el cliente.</p>\r\n\r\n<p>Cuando el precio es adecuado -no necesariamente el m&aacute;s bajo- las barreras de disuasi&oacute;n pueden ser suficientes como para fidelizar al cliente. La creaci&oacute;n de dichas barreras requiere conocer las necesidades y demandas de cada cliente, de all&iacute; la importancia del Customer Relationship Management (CRM), gesti&oacute;n de las relaciones con los clientes. Las empresas que interact&uacute;an con sus clientes por internet deben aprovechar las posibilidades de interacci&oacute;n de la Red para ajustar su oferta a las necesidades y demandas de cada cliente. El conocimiento, pues, proporciona rendimientos crecientes con su uso. Cuanto m&aacute;s se usa, tanto m&aacute;s valioso es y m&aacute;s ventaja competitiva proporciona.</p>\r\n\r\n<p>Es por esto que muchos economistas comparten hoy en d&iacute;a la opini&oacute;n de que el conocimiento se ha convertido en un recurso clave, tanto desde el punto de vista microecon&oacute;mico (organizaciones, empresas e instituciones) como desde el punto de vista macroecon&oacute;mico (Naciones y Estados).<br />\r\nFuente: http://sisbib.unmsm.edu.pe/bibvirtual/publicaciones/administracion/v06_n11/gestion.htm</p>\r\n</div>', '2', '2008-12-15', ''),
	('000001', '<p style="text-align: center;"><span style="font-size:12px;"><span style="font-family:verdana,geneva,sans-serif;"><strong>Ver para creer</strong></span></span></p>\r\n\r\n<div align="left" class="fontmartin5" style="font-family: verdana; font-size: 12px; color: rgb(63, 86, 73); clip: rect(auto auto auto auto); margin: 10px 10px 0px 25px;"><span style="font-size:12px;"><span style="font-family:verdana,geneva,sans-serif;">Hasta hace poco dec&igrave;amos el cambio clim&aacute;tico tenia efectos nefastos en nuestra vida, nuestra sociedad lo que sonaba a nuestros o&iacute;dos como hechos lejanos. Hoy en dia vemos y evidenciamos lo que ayer eran rumores una nota publicada el 12 de mayo 2008 en los titulares del diario Per&ugrave; 21dec&igrave;a ADIOS NEVADO PASTORURI ocasionado por el Calentamiento global quedando s&ograve;lo una reducida a capa de hielo uno de los nevados m&agrave;s importantes del pa&igrave;s, debido a un retroceso y disminuci&oacute;n de su superficie glaciar.</span></span></div>\r\n\r\n<div align="left" class="fontmartin5" style="font-family: verdana; font-size: 12px; color: rgb(63, 86, 73); clip: rect(auto auto auto auto); margin: 10px 10px 0px 25px;"><span style="font-size:12px;"><span style="font-family:verdana,geneva,sans-serif;">En 1995 ten&igrave;a un &agrave;rea de 1.8 km2, el 2007 se hab&igrave;a reducido a 1.1. km2 lo que significa una p&egrave;rdida del 40% de su &agrave;rea. Y &egrave;ste no es el unico hecho. Asimismo se aprecia muchas especies en extinci&oacute;n y particular en el caso del Per&ugrave;. Pinchando este enlace lo podr&agrave; comprobar. (http://www.peruecologico.com.pe/extincion.htm) Ante esta situaci&oacute;n no podemos permanecer impasibles, algo tenemos que hacer, pues es muy dif&iacute;cil actuar desde nuestra humilde posici&oacute;n de ciudadano, estudiante, trabajador. Se precisa un cambio profundo, s&igrave; un CAMBIO hacia adentro, una toma de conciencia sobre el futuro de nuestro hogar la TIERRA que cada vez est&agrave; m&agrave;s contaminada por el accionar humano, nuestros malos h&agrave;bitos.</span></span></div>\r\n\r\n<div align="left" class="fontmartin5" style="font-family: verdana; font-size: 12px; color: rgb(63, 86, 73); clip: rect(auto auto auto auto); margin: 10px 10px 0px 25px;"><span style="font-size:12px;"><span style="font-family:verdana,geneva,sans-serif;">Cu&agrave;ntas veces vemos que la calle es el basurero de muchos, por la ventana de la combi, arrojamos la basura, en casa botamos los desperdicios en una bolsa para el basurero, mezclando restos alimenticios, papel, pl&aacute;sticos, latas... y creando gases, producto de la descomposici&oacute;n de estos residuos que se evaporan y van al medio ambiente conformando GASES DE EFECTO INVERNADERO que han saturado nuestra atm&oacute;sfera formando una PLACA que impide que la energ&iacute;a cal&ograve;rica salga, qued&aacute;ndose y calentando m&agrave;s y m&agrave;s nuestro planeta, trayendo como consecuencia la alteraci&oacute;n de nuestro ECOSISTEMA, es decir alterando la vida de nuestros animales, plantas y de nosotros mismos. La naturaleza tambi&egrave;n sufre transtornos tales como deshielos, inundaciones, sequ&igrave;as</span></span></div>\r\n\r\n<div align="left" style="background-color: rgb(255, 255, 255);">\r\n<p class="fontmartin5" style="font-family: verdana; font-size: 12px; color: rgb(63, 86, 73); clip: rect(auto auto auto auto); margin: 10px 10px 0px 25px;"><span style="font-size:12px;"><span style="font-family:verdana,geneva,sans-serif;">Hagamos algo pues, CAMBIEMOS, reflexionemos. Es posible salvar lo que nos queda si yo cambio primero, entonces cambiar&agrave; mi familia, mis amigos, mis vecinos, mis colegas... y as&igrave; hacemos CADENA, el efecto multimplicador necesario para salvar nuestra casa mayor llamada TIERRA, y de este modo legamos a nuestras futuras generaciones EJEMPLO y la SUSTENTABILIDAD de nuestro MEDIO AMBIENTE.</span></span></p>\r\n</div>', '2', '2008-07-11', ''),
	('000004', '<p style="text-align: center;"><span style="font-size:12px;"><span style="font-family:verdana,geneva,sans-serif;"><strong>D&iacute;a mundial del agua</strong></span></span></p>\r\n\r\n<div align="left" class="fontmartin5" style="font-family: verdana; font-size: 12px; color: rgb(63, 86, 73); clip: rect(auto auto auto auto); margin: 10px 10px 0px 25px;">\r\n<p><span style="font-size:12px;"><span style="font-family:verdana,geneva,sans-serif;">En el marco del &ldquo;D&iacute;a Mundial del Agua&rdquo; la Universidad Peruana de las Am&eacute;ricas realiz&oacute; un&nbsp;importante evento, con la presentaci&oacute;n del tema &ldquo;El Agua y Seguridad Alimentaria&rdquo;.&nbsp;En tal sentido el Vicerector Acad&eacute;mico Dr. Enrique&nbsp;Loo Ayne en coordinaci&oacute;n con el CLUMA (Club del&nbsp;Medio Ambiente de las Am&eacute;ricas) representada&nbsp;por la Lic. Yolanda Bustamante S&aacute;nchez y el&nbsp;Ministerio de Agricultura a trav&eacute;s de la Direcci&oacute;n&nbsp;General de&nbsp;Competitividad Agraria (DGCA) han&nbsp;unido esfuerzos para la realizaci&oacute;n de este foro.<br />\r\n<br />\r\nEl evento ha tenido por finalidad la difusi&oacute;n y&nbsp;concientizaci&oacute;n de este recurso y la importancia&nbsp;del mismo, destinado a las autoridades y decanos; los mismos que har&aacute;n efecto multiplicador a la&nbsp;plana docente y alumnos de las diferentes facultades de la Universidad.&nbsp;El evento fue inaugurado por el Vicerrector Dr. Enrique Loo A. quien expres&oacute; su preocupaci&oacute;n en&nbsp;el uso eficiente de dicho recurso en todos los niveles de consumo, ya sea dom&eacute;stico, industrial,&nbsp;minero y agropecuario; y la responsabilidad que debemos tener en cuanto a preservar y cuidar&nbsp;este valioso recurso.<br />\r\n<br />\r\nPor su parte el Ing. Johan Mathews en&nbsp;representaci&oacute;n de la Direcci&oacute;n General de&nbsp;Competitividad Agraria del Ministerio de&nbsp;Agricultura realiz&oacute; una presentaci&oacute;n destacando&nbsp;la importancia del recurso h&iacute;drico y el efecto de<br />\r\nesta en la seguridad alimentaria (agricultura) del&nbsp;pa&iacute;s. Asimismo explic&oacute; que la presencia de las&nbsp;precipitaciones pluviales (lluvias) durante los&nbsp;meses de diciembre, enero y con mayor incidencia en el mes de febrero en las partes altas de las cuencas de los r&iacute;os han ofertado recursos h&iacute;dricos a&nbsp;los embalses y/o reservorios de nuestro pa&iacute;s (vol&uacute;menes adecuados); para satisfacer la demanda&nbsp;de la campa&ntilde;a agr&iacute;cola 2011 &ndash; 2012, para los cultivos comprendidos dentro del r&eacute;gimen de&nbsp;seguridad alimentaria (Arroz, Ma&iacute;z amarillo duro y Algod&oacute;n).<br />\r\n<br />\r\nPor otro lado, mencion&oacute; algunos tips importantes tales como: los alimentos que consumimos&nbsp;presentan en su composici&oacute;n del 85% al 90% de agua. Para producir 16,000 kg/ha de arroz c&aacute;scara&nbsp;se necesita entre 15,000 a 18,000 m3&nbsp;de agua y para satisfacer las intensiones de siembra en la&nbsp;campa&ntilde;a 2011-2012, del Valle de Chancay-Lambayeque (90,000 ha de siembra aproximadamente)&nbsp;requiere que el embalse de Tinajones debe presentar un 85% de capacidad &uacute;til de&nbsp;almacenamiento (285 MMC).<br />\r\n<br />\r\nFinalmente expreso la importancia y compromiso que deben tener los operadores y usuarios de&nbsp;las distintas administraciones de agua existentes para el uso agr&iacute;cola. Invoc&oacute; que la mejor forma&nbsp;de crear impactos positivos es la adopci&oacute;n de tecnolog&iacute;as de riego, la cual permita hacer un uso&nbsp;adecuado y eficiente de este recurso, tales como el riego por goteo que minimiza a un 40% el&nbsp;volumen de agua utilizado en comparaci&oacute;n con otras tipos de riego (gravedad, aspersi&oacute;n, etc.).</span></span></p>\r\n\r\n<p><span style="font-size:12px;"><span style="font-family:verdana,geneva,sans-serif;">Fuente:&nbsp;http://agroaldia.minag.gob.pe/biblioteca/download/pdf/casos-coyunturales/2012/nota_21_dia_mundial_del_agua.pdf</span></span></p>\r\n</div>', '2', '2012-03-05', '');
